import React from "react";
import { ContentDiv } from "../styledComponents";
// import Test_1 from "../img/Test_1.jpeg";

const Content = () => {
  return (
    <ContentDiv>
      <div className="contentWrapper">
        <div className="qustionBox">
          <h1>Q1</h1>
          <h1>학창시절에 주로 뭐할 때가 제일 좋았어?</h1>
        </div>
        <div className="answerBox"></div>
      </div>
    </ContentDiv>
  );
};

export default Content;
